import React from 'react';
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Head from '../GoFundNFT/head';
import GofundNFT from '../GoFundNFT/GoFundNft';
import OqueEgoFund from '../GoFundNFT/OqueEgoFund';
import PqEmitirToken from '../GoFundNFT/PqEmitirToken';
import FundoDetalheImg from '../GoFundNFT/FundoDetalheImg';
import BeneficiosDisplayFlex from '../GoFundNFT/BeneficiosPfas';
import Fundobolha from '../GoFundNFT/fundobolha';
import ComoFunciona from '../GoFundNFT/comoFunciona';
import Calculadora from '../GoFundNFT/Calculadora';
import ComeceAgg from '../GoFundNFT/ComeceAgg';
import Footer from '../LandingPage/footer';


function App(){
    return (
        <React.Fragment>
            <Head/>
            <GofundNFT/>
            <OqueEgoFund/>
            <FundoDetalheImg/>
            <PqEmitirToken/>
            <Fundobolha/>
            <BeneficiosDisplayFlex/>
            <ComoFunciona/>
            <Calculadora/>
            <ComeceAgg/>
            <Footer/>
        </React.Fragment>
    );
}

export default App;
